import Header from './Header';

const Layout = props => {
  return (
    <>
      <Header />
      {props.children}

      <style jsx global>{`
        * {
          padding: 0;
          margin: 0;
          font-family: Tahoma;
          box-sizing: border-box;
        }
      `}</style>
    </>
  );
};

export default Layout;
